INSERT INTO `page` (`id`, `title`, `slug`, `type`, `status`, `content`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(1, 'Pembayaran', 'pembayaran', 'Help & Support', 1, '<p>\r\nUntuk pembelian secara online silahkan mengikuti prosedur dari beli online sampai transfer bank,\r\n bagi Anda yang berdomisili di Jakarta sekitarnya, dapat langsung mendatangi kami yang berlokasi di Mega Kuningan untuk Cash On Delivery baik\r\ndirect secara langsung melalui form web maupun melalui BBM/Whatsapp/SMS\r\n</p>\r\n<p>\r\ndigunakan untuk melakukan konfirmasi pembayaran sehingga sistem  bisa mendeteksi secara langsung pembayaran Anda.\r\nSesaat setelah Anda melakukan pembayaran melalui Transfer Bank, \r\nAnda wajib melakukan konfirmasi ke pihak kami untuk mengecek dana yang masuk dari Anda. \r\nAnda dapat mengakses fitur ini di Halaman ini\r\n</p>\r\n', 1, '2015-02-11 10:12:50', NULL, NULL),
(2, 'Pengiriman Produk', 'pengiriman-produk', 'Help & Support', 1, NULL, 1, '2015-02-11 10:12:50', NULL, NULL),
(3, 'Pengembalian Produk', 'cara-pengembalian-produk', 'Help & Support', 1, NULL, 1, '2015-02-11 10:12:50', NULL, NULL),
(4, 'Pembelian', 'pembelian', 'Help & Support', 1, NULL, 1, '2015-02-11 10:12:50', NULL, NULL),
(5, 'FAQ', 'faq', 'Help & Support', 1, NULL, NULL, NULL, NULL, NULL),
(6, 'Mengenai Vileo', 'mengenai-vileo', 'About Us', 1, 'Vileo adalah perintis e-commerce di beberapa negara dengan pertumbuhan tercepat di dunia yang menawarkan pengalaman belanja online cepat, aman dan nyaman dengan produk-produk dalam kategori mulai dari fashion, peralatan elektronik, peralatan rumah tangga, mainan anak-anak dan peralatan olahraga. Lazada selalu berjuang untuk memberikan pelanggan yang terbaik termasuk dengan menawarkan beberapa pembayaran pilihan, pengembalian gratis, layanan konsumen dan garansi komitmen.\r\nKami terus memperluas jangkauan produk kami seperti kategori Fashion dan Jam Tangan Kami menawarkan pilihan kualitas produk terbaik yang akan Anda temukan semua pada ujung jari Anda. Belanja online di Indonesia tidak pernah semudah ini! Tetap terhubung dan dapatkan penawaran terbaru dan transaksi setiap harinya. Ingat, setiap hari adalah hari belanja di Lazada!\r\n', NULL, NULL, NULL, NULL),
(7, 'Jam Buka Vileo', 'jam-buka-vileo', 'News & Info', 1, 'Vileo adalah perintis e-commerce di beberapa negara dengan pertumbuhan tercepat di dunia yang menawarkan pengalaman belanja online cepat, aman dan nyaman dengan produk-produk dalam kategori mulai dari fashion, peralatan elektronik, peralatan rumah tangga, mainan anak-anak dan peralatan olahraga. Lazada selalu berjuang untuk memberikan pelanggan yang terbaik termasuk dengan menawarkan beberapa pembayaran pilihan, pengembalian gratis, layanan konsumen dan garansi komitmen.\r\nKami terus memperluas jangkauan produk kami seperti kategori Fashion dan Jam Tangan Kami menawarkan pilihan kualitas produk terbaik yang akan Anda temukan semua pada ujung jari Anda. Belanja online di Indonesia tidak pernah semudah ini! Tetap terhubung dan dapatkan penawaran terbaru dan transaksi setiap harinya. Ingat, setiap hari adalah hari belanja di Lazada!\r\n', NULL, NULL, NULL, NULL),
(8, 'Ketentuan Unlock Modem', 'ketentuan-unlock-modem', 'News & Info', 1, 'Vileo adalah perintis e-commerce di beberapa negara dengan pertumbuhan tercepat di dunia yang menawarkan pengalaman belanja online cepat, aman dan nyaman dengan produk-produk dalam kategori mulai dari fashion, peralatan elektronik, peralatan rumah tangga, mainan anak-anak dan peralatan olahraga. Lazada selalu berjuang untuk memberikan pelanggan yang terbaik termasuk dengan menawarkan beberapa pembayaran pilihan, pengembalian gratis, layanan konsumen dan garansi komitmen.\r\nKami terus memperluas jangkauan produk kami seperti kategori Fashion dan Jam Tangan Kami menawarkan pilihan kualitas produk terbaik yang akan Anda temukan semua pada ujung jari Anda. Belanja online di Indonesia tidak pernah semudah ini! Tetap terhubung dan dapatkan penawaran terbaru dan transaksi setiap harinya. Ingat, setiap hari adalah hari belanja di Lazada!\r\n', NULL, NULL, NULL, NULL);
INSERT INTO `product` (`id`, `name`, `sku`, `slug`, `category_id`, `brand_id`, `status`, `price`, `image`, `weight`, `short_description`, `long_description`, `latest_discussion`, `online`, `cod`, `dropshier`, `stock`, `review`, `counter`, `best_seller`, `total_sell`, `arrival_date`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(1, 'THREE- AON Kuota Regular 5GB  Aktif 1 Tahun ', 'TR-0001', 'three-aon-kuota-regular-5gb-aktif-1-tahun', 6, 1, 1, 55000, 'three-5gb-aon.png', '30', '<p>Free internet 1 tahun, Dengan Kuota Kurang lebih 5GB. Setelah Kuota habis hanya bisa akses ke 11 situs populer tertentu selama setahun dari pertama kali kartu di aktifkan. Kartu ini sudah aktif dari selama 1 Tahun Kurang. Kartu yang sudah di gunakan bisa digunakan kembali.</p>', '<p>Pada akhirnya, kebebasan menjadi batasan yang membuat kamu menjadi lebih boros. Apalagi dengan adanya ketentuan "pemakaian wajar" yang membuat kecepatan internetmu berkurang, atau bahkan bisa terjebak membayar lebih mahal setelah kuota yang ditentukan habis.Jika kamu merasa kebebasan itu omong kosong Think again.</p>\r\n<p>Kini dengan AlwaysOn, rasakan kebebasan berinternet tanpa syarat.Bebas internet sepuasnya tanpa kuota/pulsa. Bebas akses 11 situs populer, FULL SPEED, tanpa pake kuota/pulsa selama masa pakai internet masih berlaku.</p>\r\n<p>Berikut ini 11 situs yang dapat kamu akses secara bebas:</p>\r\n<ul style="list-style-type: undefined;">\r\n<li>Facebook</li>\r\n<li>Google</li>\r\n<li>Detik</li>\r\n<li>Klik BCA</li>\r\n<li>Twitter</li>\r\n<li>Mobile Kompas</li>\r\n<li>Toko Bagus</li>\r\n<li>Oke Zone</li>\r\n<li>Viva News</li>\r\n<li>Chatting (FB Messenger, YM Messenger, AOL, ICQ, GTalk, MSN)</li>\r\n<li>Kaskus</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Asiknya lagi, setiap bulannya kamu akan mendapat bonus kuota 50MB/bulan dan terus terakumulasi setiap kamu isi ulang, yang bisa kamu gunakan untuk akses ke situs lainnya berikut adalah spesifikasi three aon :</p>\r\n<ul style="list-style-type: undefined;">\r\n<li>Kartu perdana Internet bisa telpon dan sms</li>\r\n<li>Always On selama 12 bulan ( masa aktif internet 12 bulan )</li>\r\n<li>Masa aktif kartu februari-maret 2015 - Kuota 5GB + bonus 600Mb ( 600Mb diakumulasi 50 Mb per bulan selama 12 bulan )</li>\r\n<li>Gratis akses 11 situs terkenal seuai diatas tanpa dikenakan kuota</li>\r\n<li>Pilihan nomor acak - GRATIS BBM 1 TAHUN apabila di gunakan/dipakai pada handphone BlackBerry tipe Z10 ( untuk info lebih lengkap silahkan hub TRI di 123 ).</li>\r\n</ul>', 9, 1, 1, 1, 10, 1, 0, 1, NULL, '2015-02-26', 1, NULL, NULL, NULL),
