(4, 'Voucher Fisik XL Nominal 25.000 Expired 01/03/2016', 'XL-0001', 'voucher-fisik-xl-nominal-25000-expired-01032016', 5, 5, 1, 28200, 'xl-25.png', '50', '<p>Vileo.co.id menyediakan beberapa voucher fisik&nbsp; XL dengan nominal <em><strong>25.000</strong></em>&nbsp; atau voucher gesek dengan sistem transaksi sama seperti transaksi pengisian pulsa elektrik, namun hanya berbeda dalam cara memasukan pulsa ke No HP user/konsumen</p>', '<p>Vileo.co.id menyediakan beberapa voucher fisik&nbsp; XL dengan nominal 25.000&nbsp; atau voucher gesek dengan sistem transaksi sama seperti transaksi pengisian pulsa elektrik, namun hanya berbeda dalam cara memasukan pulsa ke No HP user/konsumen.Meskipun demikian, cara mengisi ulang pulsa menggunakan voucher fisik juga perlu kita diketahui karena siapa tahu nanti kita akan mengalami situasi dimana kita mendapati konter yang tidak menjual voucher elektrik (kehabisan) ataupun gagal masuk pulsa</p>', 1, 1, 1, 1, 11, 0, 1, 0, NULL, NULL, 1, NULL, NULL, NULL),
